import React from "react";
import DreveskoCard from "./DreveskoCard";

const DreveskoList = ({title, cards}) => {
    return (
        <div style={styles.container}>
            <h4>{title}</h4>
            { cards.map(card => <DreveskoCard text={card.text} />) }
        </div>
    )
};

const styles = {
    container: {
        backgroundColor: "#ccc",
        borderRadius: 3,
        width: 300,
        padding: 8,
        marginRight: 10
    }
}

export default DreveskoList;
